    {
      "cell_type": "code",
      "metadata": {
        "id": "MUInB6CxRMmY",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "import scipy.stats as stats\n",
        "\n",
        "def power_spectrum(images):\n",
        "  Ab = []\n",
        "  for image in images:\n",
        "    fourier_image = np.fft.fftn(image)\n",
        "    fourier_amplitudes = np.abs(fourier_image) ** 2\n",
        "\n",
        "    kfreq = np.fft.fftfreq(128) * 128\n",
        "    kfreq2D = np.meshgrid(kfreq, kfreq)\n",
        "    knrm = np.sqrt(kfreq2D[0]**2 + kfreq2D[1]**2)\n",
        "\n",
        "    knrm = knrm.flatten()\n",
        "    fourier_amplitudes = fourier_amplitudes.flatten()\n",
        "\n",
        "    kbins = np.arange(0.5, 64., 1.)\n",
        "    kvals = 0.5 * (kbins[1:] + kbins[:-1])\n",
        "\n",
        "    Abins, _, _ = stats.binned_statistic(knrm, fourier_amplitudes, statistic = \"mean\", bins = kbins)\n",
        "    Abins *= 4. * np.pi / 3. * (kbins[1:]**3 - kbins[:-1]**3)\n",
        "  Ab.append(Abins)\n",
        "  Abins = np.mean(np.array(Ab), 0)\n",
        "  return kvals, Abins"
      ],
      "execution_count": 32,
      "outputs": []
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "7ZsZyopB07oI",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "kvals, Abins = power_spectrum(images[:1000])"
      ],
      "execution_count": 33,
      "outputs": []
    },
